  "/KonwCcs82i--3.png",
];
export default function KonwCcs82i() {
  return (
    <div>
      <Dump id="joy">
        {sourceURLS.map((url, index) => (
          <img className="workComponent" src={url} key={index} />
        ))}
      </Dump>
      <style jsx>{`
        .workComponent {
          max-width: 425px;
        }
      `}</style>
    </div>
  );
}
